const connectMap2Table = (e) => {
  const mapID = e.currentTarget.id;
  const city = IDObject[mapID];
  const offset = $(`#${city}`).position();
  $("#ktable").animate({scrollTop: 50}, 10)
  if(!$(`#${city}`).hasClass("selected")){
    $(`#${city}`).addClass("selected");
  } else $(`#${city}`).removeClass("selected");
}

const leaveEvent = (e) => {
  const mapID = e.currentTarget.id;
  const city = IDObject[mapID];
  const offset = $(`#${city}`).offset();
  if(!$(`#${city}`).hasClass("selected")){
    $(`#${city}`).addClass("selected");
  } else $(`#${city}`).removeClass("selected");
}


const connectTable2Map = (e) => {
  const rowID = e.currentTarget.id;
  for(let i = 0; i < Object.keys(IDObject).length; i++) {
    if(IDObject[Object.keys(IDObject)[i]] == rowID) {
      const mapID = $(`#${Object.keys(IDObject)[i]}`);
      if(!mapID.hasClass("selected")){
      mapID.addClass("selected")
      } else mapID.removeClass("selected")
    }  
  }
}


const showNewmap = (area) => {
  let map;
  $("#detail").text("");
  $("#map").css("zIndex", "2")
  $("#detail").data("status", "closed");
  $("#detail").css("width", "0");
  $("#detail").html("");
  $("#map").html("")
  switch(area){
    case '경기도': map = GyeonggiMap; break;
    case '한국': map = KrMap; break;
    case '서울': map = SeoulMap; break;
  }
  map.appendTo(mapDiv);
  for(i of Object.keys(IDObject)){
  const area = $("#"+i)
  area.addClass("cityinMap");
  area.mouseenter((e)=> {
    connectMap2Table(e);
  })
  area.mouseleave((e)=> {
    leaveEvent(e);
  })
}

}

